import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六癸日丙辰时断</p><p>六癸日生时丙辰，偏官无气未为贫；若无木气通其局，定是清高福禄人。</p><p>癸日丙辰时，身坐官库，癸用戊己为官，辰上土墓为官库，见丙为财，辰为水局，丙火无气，癸水合局，柱无甲破官损库，主贵。</p><p>癸丑日丙辰时，平。</p><p>辰戌丑未月，财官有气，贵。</p><p>癸卯日丙辰时，孤独难为椿萱，有财帛，贵，人钦敬。</p><p>卯亥年月，日贵格。</p><p>午戌，九品至五品。</p><p>寅月，行南运，风宪。</p><p>癸巳日丙辰时，子月生，南方，山明水秀，地方，高贵。</p><p>子未年月，富厚。</p><p>戌卯，近侍。</p><p>未戌申，儒官。</p><p>癸未日丙辰时，高。</p><p>寅卯未月，平常。</p><p>辰戌丑月，吉，巳月，财官俱旺，贵。</p><p>癸酉日丙辰时，孤，贵。</p><p>巳酉丑月，贵。</p><p>寅卯，不吉。</p><p>子午，富。</p><p>戌月，大贵。</p><p>癸亥日丙辰时，柱无甲木破损官库，贵，运南。</p><p>癸日丙辰官库闭，财星虽透却无气；官要匙开财要兴，柱逢卯戊方为贵。</p><p>癸日丙辰时遇，库中锁闭财官，要逢卯戊钥匙开，守祖六亲阻碍。</p><p>暗有食神相助，空乏虚度资财，先贫后富命中排，改祖重兴渐快。</p>",25),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","279卷 九·六癸日丙辰时断.html.vue"]]);export{f as default};
